import React from "react";
import "./style.css";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";

const Product = ({ item: { title, price, description, img } }) => {
  return (
    <div classname="product" style={{ width: "15rem", margin: "1rem" }}>
      <Card>
        <CardImg
          top
          width="100%"
          src={require("../images/Header-Background.jpg")}
          alt="product"
        />
        <CardBody>
          <CardText style={{ fontWeight: "bold" }}>{title}</CardText>
          <CardText>{description}</CardText>
          <CardSubtitle style={{ fontWeight: "bold" }}>${price}</CardSubtitle>
          <Button color="info">Add to Cart</Button>
        </CardBody>
      </Card>

      <div className="item">
        <img src="" alt="" />
        <p>{title} </p>
        <p> {description}</p>
        <div>
          <Button color="info">Add to Cart</Button>
          <p>${price}</p>
        </div>
      </div>
    </div>
  );
};

export default Product;
